import React from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";

function Register() {
  return (
    <Box component="form">
      <TextField
        fullWidth
        id="username"
        label="お名前"
        margin="normal"
        required
      />
    </Box>
  );
}

export default Register;
